  `created_at` datetime DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `discount` decimal(10,0) NOT NULL DEFAULT '0',
  `status` tinyint(1) DEFAULT '0' COMMENT '0: Stock, 1: out of stock',
  `social_publish` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL,
